import React from 'react';
import { PDFDownloadLink, Document, Page, Text, View, StyleSheet } from '@react-pdf/renderer';

const styles = StyleSheet.create({
  page: { padding: 30, backgroundColor: '#1f2937' },
  section: { margin: 10, padding: 10 },
  header: { fontSize: 24, marginBottom: 20, color: '#ffffff', fontWeight: 'bold' },
  subheader: { fontSize: 18, marginBottom: 10, color: '#ffffff', fontWeight: 'bold' },
  text: { fontSize: 12, marginBottom: 5, color: '#ffffff' },
  bold: { fontWeight: 'bold' },
  row: { flexDirection: 'row', justifyContent: 'space-between', marginBottom: 5 },
});

const QuotePDF = ({ quote, customerInfo, type, options }) => {
  const renderCustomerInfo = () => {
    return Object.entries(customerInfo).map(([key, value]) => {
      if (key === 'address') {
        return Object.entries(value).map(([addressKey, addressValue]) => (
          <Text key={addressKey} style={styles.text}>
            <Text style={styles.bold}>{addressKey.charAt(0).toUpperCase() + addressKey.slice(1)}:</Text> {addressValue}
          </Text>
        ));
      }
      if (key !== '_id') {
        return (
          <Text key={key} style={styles.text}>
            <Text style={styles.bold}>{key.charAt(0).toUpperCase() + key.slice(1)}:</Text> {value}
          </Text>
        );
      }
      return null;
    });
  };

  const renderOptions = () => {
    return Object.entries(options).map(([key, value]) => (
      <Text key={key} style={styles.text}>
        {key.charAt(0).toUpperCase() + key.slice(1).replace(/([A-Z])/g, ' $1')}: {value.toString()}
      </Text>
    ));
  };

  return (
    <Document>
      <Page size="A4" style={styles.page}>
        <View style={styles.section}>
          <Text style={styles.header}>Quote for {type.replace('_', ' ')} Services</Text>
          
          <Text style={styles.subheader}>Customer Information</Text>
          {renderCustomerInfo()}

          <Text style={styles.subheader}>Service Details</Text>
          <Text style={styles.text}>
            <Text style={styles.bold}>Service Type:</Text> {type.replace('_', ' ')}
          </Text>
          <Text style={styles.text}>
            <Text style={styles.bold}>Area:</Text> {quote.area} sq ft
          </Text>
          
          <Text style={styles.subheader}>Options</Text>
          {renderOptions()}

          <Text style={styles.subheader}>Pricing</Text>
          <View style={styles.row}>
            <Text style={styles.text}>Base Price:</Text>
            <Text style={styles.text}>${quote.basePrice}</Text>
          </View>
          <View style={styles.row}>
            <Text style={styles.text}>Weighted Price:</Text>
            <Text style={styles.text}>${quote.weightedPrice}</Text>
          </View>
          <View style={styles.row}>
            <Text style={styles.text}>Additional Price:</Text>
            <Text style={styles.text}>${quote.additionalPrice}</Text>
          </View>
          <View style={styles.row}>
            <Text style={styles.bold}>Total Price:</Text>
            <Text style={styles.bold}>${quote.totalPrice}</Text>
          </View>

          <Text style={[styles.text, { marginTop: 20 }]}>
            This quote is valid for 30 days from the date of issue.
          </Text>
        </View>
      </Page>
    </Document>
  );
};

export const QuoteDownloadLink = ({ quote, customerInfo, type, options }) => (
  <PDFDownloadLink
    document={<QuotePDF quote={quote} customerInfo={customerInfo} type={type} options={options} />}
    fileName="quote.pdf"
    className="bg-indigo-600 text-white px-4 py-2 rounded mt-4 inline-block hover:bg-indigo-500"
  >
    {({ loading }) => (loading ? 'Generating document...' : 'Download PDF')}
  </PDFDownloadLink>
);

export default QuotePDF;
